import React, { useState, useEffect } from 'react';
import './App.css';
import logo from './images/beamit-ai-logo.png';
import ImageGallery from './components/ImageGallery';
import AvatarSelection from './components/AvatarSelection';

function App() {
  const [images, setImages] = useState([]);

  useEffect(() => {
    fetch('/pfp')
      .then(response => response.json())
      .then(data => setImages(data.images))
      .catch(error => console.error('Error fetching images:', error));
  }, []);

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} alt="Beamit AI Logo" />
        <h1>2D to 3D - it is for real</h1>
      </header>
      <div className="App-content">
        <AvatarSelection />
        <ImageGallery images={images} />
        <button onClick={() => alert('Generate Avatar')}>Generate Avatar</button>
        <button onClick={() => alert('Upload Image')}>Upload Image</button>
      </div>
    </div>
  );
}

export default App;
